import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import { Typography } from "@material-ui/core";
import logo from "../../img/home/ischool-logo.png";
import Divider from "@material-ui/core/Divider";
import Button from "@material-ui/core/Button";
import Paper from "@material-ui/core/Paper";

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: 120,
  },
  root: {
    flexGrow: 1,
    backgroundColor: "#003367",
  },
  grid: {
    marginTop: 30,
  },
  divider: {
    marginTop: 60,
    height: 6,
    width: 80,
    backgroundColor: "#FF8686",
    justifyContent: "center",
  },
  footerHeading: {
    color: "#003367",

    [theme.breakpoints.down("sm")]: {
      fontSize: 24,
    },
    fontSize: 28,
  },

  logoImg: {
    width: "20%",
    height: "20%",
    [theme.breakpoints.down("sm")]: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
    },
  },

  footerTitle: {
    marginRight: 40,
    marginLeft: 40,

    [theme.breakpoints.down("sm")]: {
      fontSize: 20,
    },
  },

  footerBody: {
    marginRight: 60,
    lineHeight: 2,
    marginLeft: 40,
    color: "white",
  },
  highlightText: {
    color: "#FF8686",
  },

  footerText: {
    marginTop: 30,
    marginLeft: 80,
    marginRight: 80,
    [theme.breakpoints.down("xs")]: {
      marginLeft: 10,
      marginRight: 10,
    },
  },
}));

export default function Footer() {
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div className={classes.root}>
        <Grid container spacing={0}>
          <Grid item xs={12}>
            <Box
              mb={8}
              display="flex"
              flexDirection="column"
              alignItems="center"
              className={classes.footerText}
            >
              <br></br>
              <img src={logo} alt="ischoollogo" className={classes.logoImg} />
              <br></br>
              <Typography variant="body2" className={classes.footerBody}>
                Support | Get Started | Terms of Use
              </Typography>
              <br></br>
              <Typography variant="caption" className={classes.footerBody}>
                Â© 2020 Eclipse
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}
